import React from "react";
import bgImage from "../assets/images/photo5@2x.jpg";

const Help = () => {
  return (
    <main id="main-container">
      <div className="bg-image" style={{ backgroundImage: `url(${bgImage})` }}>
        <div className="bg-gd-white-op-rl text-center">
          <div className="content content-boxed content-full py-5 py-md-7">
            <div className="row justify-content-center">
              <div className="col-md-10 col-xl-6">
                <h1 className="h2 mb-2">How can we help?</h1>
                <p className="font-size-lg font-w400 text-muted">
                  We offer the most complete support to our customers. We are
                  here for your service.
                </p>
              </div>
            </div>
          </div>
        </div>
      </div>
    </main>
  );
};

export default Help;
